import React from 'react';
import "react-vis/dist/style.css";
import {
  XYPlot,
  LineSeries,
  XAxis,
  YAxis,
  VerticalGridLines,
  HorizontalGridLines,
} from "react-vis";

const Chart = () => {
  const data = [
    { x: 0, y: 200 },
    { x: 1, y: 220 },
    { x: 2, y: 280 },
    { x: 3, y: 310 },
    { x: 4, y: 350 },
    { x: 5, y: 360 },
    { x: 6, y: 430 },
    { x: 7, y: 470 },
    { x: 8, y: 510 },
    { x: 9, y: 500 },
    { x: 10, y: 480 },
    { x: 11, y: 530 },
    { x: 12, y: 580 },
  ];
  return (
    <div style={{ marginTop: "15px" }} >
      <XYPlot  height={300} width={430}>
        <VerticalGridLines />
        <HorizontalGridLines />
        <XAxis />
        <YAxis />
        <LineSeries data={data} color="hotpink" />
      </XYPlot>
    </div>
  );
};

export default Chart;
